"use strict";

$(document).ready(function () {
  const carousels = document.querySelectorAll('.hero-teaser-carousel-height.mobile-half-width');
  const buttons = document.querySelectorAll('.teaser-wrap-nav');

  function setCarouselProperties(carousel, button) {
    const imgSection = carousel.querySelectorAll('.image-section');
    const topCon = carousel.querySelectorAll('.detail-dynamic');
    const bottomCon = carousel.querySelectorAll('.info-section-dynamic');
    const imgMobile = carousel.querySelectorAll('.mobile-image-dynamic');
    const sectionHeight = carousel.offsetHeight;
    const arrTop = [];
    const arrBottom = [];

    button.style.width = imgSection[0].offsetWidth + 'px';

    for (let j = 0; j < topCon.length; j++) {
      arrTop.push(topCon[j].offsetHeight);
      arrBottom.push(bottomCon[j].offsetHeight);
      imgMobile[j].style.height = sectionHeight - arrTop[j] - arrBottom[j] + 'px';
    }

    return arrBottom;
  }

  //Buttons postion
  function updateTeaserBannerButtons() {
    for (let i = 0; i < carousels.length; i++) {
      const carousel = carousels[i];
      const button = buttons[i];
      const teaserSlickButton = carousel.querySelectorAll('.teaser-wrap-nav .slick-slide');
      const arrBottom = setCarouselProperties(carousel, button);

      for (let j = 0; j < teaserSlickButton.length; j++) {
        const slide = teaserSlickButton[j];

        slide.addEventListener('click', function () {
          if (window.innerWidth >= 768 && window.innerWidth <= 1024) {
            button.style.bottom = `${arrBottom[j] + 24}px`;
          } else if (window.innerWidth < 768) {
            button.style.bottom = `${arrBottom[j] + 12}px`;
          }
        });
      }

      function handleButtonEvent() {
        for (let k = 0; k < teaserSlickButton.length; k++) {
          if (teaserSlickButton[k].classList.contains('slick-current')) {
            if (window.innerWidth >= 768 && window.innerWidth <= 1024) {
              button.style.bottom = `${arrBottom[k] + 24}px`;
            } else if (window.innerWidth < 768) {
              button.style.bottom = `${arrBottom[k] + 12}px`;
            }
          }
        }
      }

      carousel.addEventListener('touchend', handleButtonEvent);
    }
  }

  //Page onload first
  function onloadButtons() {
    for (let i = 0; i < carousels.length; i++) {
      const carousel = carousels[i];
      const button = buttons[i];
      const arrBottom = setCarouselProperties(carousel, button);

      if (window.innerWidth >= 768 && window.innerWidth <= 1024) {
        button.style.bottom = `${arrBottom[0] + 24}px`;
      } else if (window.innerWidth < 768) {
        button.style.bottom = `${arrBottom[0] + 12}px`;
      }
    }
  }

  window.addEventListener('resize', updateTeaserBannerButtons);

  onloadButtons();
  updateTeaserBannerButtons();
});

