$(document).ready(function () {
    let $containerVideo = $($(".cmp-video-cardLine_section"))
    let isDragging = false
    let startX = 0
    let startScrollLeft = 0

    $(".cmp-video-cardLine_videoContainer").each((index, ele) => {
        // Set the width of the carousel
        let maxWidth = 0
        $(ele).children().children().each((i, elm) => {
            maxWidth += $(elm).outerWidth(true)
        })
        maxWidth += 5
        $($(ele).children()[0]).css("width", maxWidth)
        //


        // Hide the progress bar if the carousel content is smaller than the container width
        if (maxWidth < $($($(".cmp-video-cardLine_videoContainer")[index])).outerWidth()) {
            $($(".processHandle")[index]).css("display", "none")
        } else {
            $($(".processHandle")[index]).css("display", "block")
        }
        //

        // Drag-and-drop function on the PC
        $(ele).mousedown(function (event) {
            isDragging = true
            startX = event.clientX
            startScrollLeft = $(ele).scrollLeft()
        })

        $(ele).mousemove(function (event) {
            if (!isDragging) return

            const offsetX = event.clientX - startX
            const newScrollLeft = startScrollLeft - offsetX
            const maxX = $($(ele).children()[0]).width() - $(ele).width()
            const clampedScrollLeft = Math.min(Math.max(0, newScrollLeft), maxX)

            $(ele).scrollLeft(clampedScrollLeft)
            const percentage = (clampedScrollLeft / maxX) * 100
            // $($(".processHandle")[index]).val(percentage)
            $(ele).find(".processHandle").val(percentage)
        })

        $(ele).mouseup(function () {
            isDragging = false
        })
        //

        // Drag-and-drop function on the Mobile
        $(ele).on("touchstart", function (event) {
            isDragging = true
            startX = event.touches[0].clientX
            startScrollLeft = $(ele).scrollLeft()
        })

        $(ele).on("touchmove", function (event) {
            if (!isDragging) return

            const offsetX = event.touches[0].clientX - startX
            const newScrollLeft = startScrollLeft - offsetX
            const maxX = $($(ele).children()[0]).width() - $(ele).width()
            const clampedScrollLeft = Math.min(Math.max(0, newScrollLeft), maxX)

            $(ele).scrollLeft(clampedScrollLeft)
            const percentage = (clampedScrollLeft / maxX) * 100
            $($(".processHandle")[index]).val(percentage)
        })

        $(ele).on("touchend", function () {
            isDragging = false
        })

        // Show the video by click
        const playIcon = $(ele).find(".play-icon")
        const sectionContainer = $(ele).find(".section-container")
        for (let i = 0; i < $containerVideo.children().length; i++) {

            // PC showVideo By clicking
            $(playIcon[i]).on("click", () => {
                var closeButton = $(sectionContainer[i]).find(".close-button ")
                $("body").addClass("is-fullscreen-video")
                const video = $(sectionContainer[i]).find(".section-card-videos")
                video.css("display", "flex")
                const audiVideo = video.find("audi-video")
                const $html = $('html')
                audiVideo[0].refresh()
                video.addClass("show")

                closeButton.addClass("showBtn")
                closeButton.addClass("pc-btn")
                closeButton.on("click", () => {
                    audiVideo[0].video.pause()
                    video.removeClass("show")
                    video.css("display", "none")
                    closeButton.removeClass("shoBtn")
                    closeButton.removeClass("pc-btn")
                    $("body").removeClass("is-fullscreen-video")
                })

                const $headerHeight = $('.aem-Grid > .nav-wrapper').height()
                const $parentContainers = $(".cmp-video-cardLine")
                $parentContainers.each(function (index, ele) {
                    $(ele).on("click", () => {
                        const targetOffset = $(ele).offset().top
                        $html.animate({scrollTop: targetOffset < $headerHeight ? 0 : targetOffset})
                        $html.stop(true, true)
                    })
                })
            })


            // Mobile showVideo By touching
            $(playIcon[i]).on("touchstart", () => {
                var closeButton = $(sectionContainer[i]).find(".close-button ")
                $("body").addClass("is-fullscreen-video")
                const video = $(sectionContainer[i]).find(".section-card-videos")
                video.css("display", "flex")
                const audiVideo = video.find("audi-video")
                const $html = $('html')
                audiVideo[0].refresh()
                video.addClass("show")

                //     edit padding
                if ($("body").hasClass("mobile")) {
                    $(sectionContainer[i]).find(".card-video").css("padding", "0")
                    $(sectionContainer[i]).find(".card-video").addClass("editHeight")
                }

                //closeButton Handle

                closeButton.addClass("showBtn")
                closeButton.addClass("mobileBtn")
                closeButton.on("touchstart", () => {
                    audiVideo[0].video.pause()
                    video.removeClass("show")
                    video.css("display", "none")
                    closeButton.removeClass("shoBtn")
                    closeButton.removeClass("mobileBtn")
                    $("body").removeClass("is-fullscreen-video")
                })
                const $headerHeight = $('.aem-Grid > .nav-wrapper').height()
                const $parentContainers = $(".cmp-video-cardLine")
                $parentContainers.each(function (index, ele) {
                    $(ele).on("touchstart", () => {
                        const targetOffset = $(ele).offset().top
                        $html.animate({scrollTop: targetOffset < $headerHeight ? 0 : targetOffset})
                        $html.stop(true, true)
                    })
                })
            })
        }
    })
    //


})



