      function updateProgress(video) {
          var player_control = $(video.target).parents('.aui-player').find('.aui-player__chrome');

          if (player_control.find('.aui-custom-player__video-progress').length) {
            player_control.find('.aui-custom-player__video-progress .seek').val(Math.floor(video.target.currentTime));
            player_control.find('.aui-custom-player__video-progress progress').val(Math.floor(video.target.currentTime));
            seek_progress_update(player_control.find('.aui-custom-player__video-progress .seek'));
          } else {
            seek_progress_update(player_control, video);
          }


      }

      function initializeVideo(video) {
        var player_control =  $(video.target).parents('.aui-player').find('.aui-player__chrome');
          //console.log(video);

          if (player_control.find('.aui-custom-player__video-progress').length) {
          const videoDuration = Math.round(video.target.duration);
          player_control.find('.aui-custom-player__video-progress .seek').attr('max', videoDuration);
          player_control.find('.aui-custom-player__video-progress progress').attr('max', videoDuration);
          seek_progress_update(player_control.find('.aui-custom-player__video-progress .seek')); 
        } else {
          seek_progress_update(player_control, video);
        }

        
        // player_control.find('.aui-custom-player__video-progress .seek').attr('max', videoDuration);
        // player_control.find('.aui-custom-player__video-progress progress').attr('max', videoDuration);

        //const time = formatTime(videoDuration);
        //duration.innerText = `${time.minutes}:${time.seconds}`;
        //duration.setAttribute('datetime', `${time.minutes}m ${time.seconds}s`);
      }

      function skipAhead(event) {
        const skipTo = event.target.dataset.seek
          ? event.target.dataset.seek
          : event.target.value;
          if (window.innerWidth < 760){
              $(event.target).parents('.aui-player').find('video')[1].currentTime = skipTo;
          }else{
              $(event.target).parents('.aui-player').find('video')[0].currentTime = skipTo;
          }
        $(event.target).parent().find('progress').val(skipTo);
        $(event.target).val(skipTo);
        seek_progress_update($(event.target));	
        //console.log(event.target);
      }


      function seek_progress_update(seek, video = null){
        if (video) {

          var seek_progress = seek.find('.aui-player__progress--progress');
          var seek_progress_head = seek.find('.aui-player__playhead');
          var seek_progress_holder = seek.find('.aui-player__seek-holder');

          const currentDuration = Math.round(video.target.currentTime);
          const videoDuration = Math.round(video.target.duration);
          
        //  console.log(seek);
          seek_progress.css("width",(currentDuration/videoDuration)*100+"%");
          seek_progress_head.css("left",(currentDuration/videoDuration)*100+"%");
          seek_progress_holder.css("width",(currentDuration/videoDuration)*100+"%");
        } else {
          var seek_progress = seek.parents('.aui-custom-player__video-progress').find('.seek-progress');
          //  console.log(seek);
          seek_progress.css("width",(seek.val()/seek.attr('max'))*100+"%");
        }
      }


      var desktop_video = $('.aui-player').find('.video-player.desktop-video'); //getting mobile video

      var mobile_video = $('.aui-player').find('.video-player.mobile-video');
      if (desktop_video.length === 0 || mobile_video.length === 0) return 0;
