	if ($cmp.length === 0)
		return;
	$cmp.find(".more-option").on('click', function() {
		if (menu.css("display") !== "none") {
			$cmp.css({
				"height" : "unset"
			});
			menu.css({
				"display" : "none"
			});
		} else {
			menu.css({
				"display" : "flex"
			});
			$cmp.css({
				"height" : "unset"
			});


			// edit mobile menu css
			if($("body").hasClass("mobile")){
				if($cmp.find(".more-items").length <= 3){
					$cmp.find(".more-content").css("height","78px")
				}else{
					$cmp.find(".more-content").css("height","140px")
				}
			}
		}
	});

		//mobile Hide menu
		$(window).on("touchstart",function (e){
			var e = e || window.event;
			var elem = e.target;
			var startX, startY;
			if($(elem).closest(".cmp-scrollable-menu").length === 1){

			}else{
				startX = e.touches[0].pageX;
				startY = e.touches[0].pageY;
				var endX, endY;
				endX = e.changedTouches[0].pageX;
				endY = e.changedTouches[0].pageY;
				var direction = GetSlideDirection(startX, startY, endX, endY);
				switch(direction) {
					case 0:case 1:case 2:
						if(menu.css("display") === "flex") {
							menu.css({
								"display": "none"
							});
							$cmp.css({
								"height" : "unset"
							});
						}
						break;
					default:
				}
			}
		})
	//pc Hide menu
	$(window).on("click",function (e){
		var e = e || window.event;
		var elem = e.target;
		if($(elem).closest(".cmp-scrollable-menu").length === 1){

		}else{
			if(menu.css("display") === "flex") {
				menu.css({
					"display": "none"
				});
				$cmp.css({
					"height" : "unset"
				});
			}
		}
	})
	window.addEventListener("wheel",function (){
		if(menu.css("display") === "flex") {
			menu.css({
				"display": "none"
			});
			$cmp.css({
				"height" : "unset"
			});
		}
	})

	//judge slide direction
	function GetSlideDirection(startX, startY, endX, endY) {
		var dy = startY - endY;
		var result = 0;
		if(dy>0) { // up
			result=1;
		}else if(dy<0){ //down
			result=2;
		}
		else
		{
			result=0;
		}
		return result;
	}

