// ----------------------------------------------------------------------------
(function (window, document) {
    console.log('show-hide-scheduler');
    var $comps = $(".show-hide-scheduler"); 
    if (!$comps.length) return;
    
    $(".root").append($comps);
    
     var timesUp = function(dest){
        var destDate = (new Date(dest).getTime())/1000;
        var currentDate = (new Date().getTime())/1000;
        return (currentDate >= destDate);  
     };
     
    // collect data
    var actions = $comps.find("actions action");
    
    var showSection = function(elm){
        elm.show();
        elm.closest(".section").show();
    };
    var hideSection = function(elm){
        elm.hide();
        elm.closest(".section").hide();
    };
    var preprocess = function(elm, date){
        elm.hide();
        elm.closest(".section").hide();
    };
    
    // process
    actions.each(function(i, elm){
         var $action = $(elm);
         // action can be extended to be more than show/hide
         var isPositiveAction = ($action.data("action") === "show") ? true : false;
         var dateValue = $action.data("date"); // example format -- 2021/07/12 15:00:00
         if(!dateValue) return;
         var comps = $action.data("comps");
         if(!comps) return;
         var everyComp = $(comps.split(",").map(c => `#${c.trim()}`).join());
         
         // preprocess
         hideSection(everyComp);
         
         // positive action
         if(isPositiveAction){
            if(timesUp(dateValue)){
                showSection(everyComp);
            }else{
                hideSection(everyComp);
                this.timer = setInterval(function(){
                    if(timesUp(dateValue)){
                        console.debug('timer up, handle positive action for', everyComp );
                        showSection(everyComp);
                        clearInterval(this.timer);
                    }else{
                        hideSection(everyComp);
                    }
                }, 1000);
            }
         }

        // negative action 
         else{
             if(timesUp(dateValue)){
                 hideSection(everyComp);
             }else{
                 showSection(everyComp);
                 this.timer = setInterval(function(){
                     if(timesUp(dateValue)){
                         console.debug('timer up, handle negative action for', everyComp );
                         hideSection(everyComp);
                         clearInterval(this.timer);
                     }else{
                         showSection(everyComp);
                     }
                 }, 1000);
             }
         }
    });
})(window, document);
