"use strict";

(function (window, document) {
  let result = $('.image-gallery-slide-for').slick({
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: false,
    infinite: true,
    fade: true,
    asNavFor: '.image-gallery-slide-nav'
  }); //slidesToShow

  Array.from(result).forEach((element, index) => {
    $(element).addClass(`image-gallery-slide-for-${index}`)
    
    $(element).on('beforeChange', function(event, slick, currentSlide, nextSlide){
      let currentSlideItem = $($(event.currentTarget).find(".slick-slide").get(currentSlide));

      let curVideo = currentSlideItem.find(".aui-js-player-play-toggle")
      let isPlayForCurVideo = currentSlideItem.find(".aui-player").hasClass("is-playing")
      if (curVideo.length && isPlayForCurVideo) {
        $(curVideo[0]).trigger('click')
      }
  });
  });
  let slickNavFors = $('.image-gallery-slide-nav');

  for (let index = 0; index < slickNavFors.length; index++) {
    const slickNavFor = $(slickNavFors[index]);
    
    slickNavFor.slick({
      infinite: true,
      slidesToShow: 10,
      slidesToScroll: 1,
      arrows: false,
      dots: false,
      useTransform: false,
      focusOnSelect: true,
      asNavFor: `.image-gallery-slide-for-${index}`,
      responsive: [{
        breakpoint: 1024,
        settings: {
          slidesToShow: 5
        }
      }]
    });
  }

  $(window).on("screenified", function (e, param) {



    $(".cmp-picture-gallery").closest(".section").each(function () {
      console.log(this);
      this.style.setProperty('height', 'auto');
    });
  });

})(window, document);
