(function (window, document) {
  var $cmp = $(".cmp-card-carousel");
  if ($cmp.length === 0) return; //-------------------------------
  // card filtering
  //-------------------------------

  var getCardLength = function getCardLength(carousel) {
    return carousel.find(".slick-slide").length;
  };

  var cardFiltering = function cardFiltering(carousel, model) {
    if (model == undefined) return; // clean filter

    carousel.slick('slickUnfilter'); // start filter

    carousel.slick('slickFilter', function (i, item) {
      if ($(item).find(".cmp-card-carousel__item").data("model") === model) {
        return true;
      } else {
        return false;
      }
    });
    var count = getCardLength(carousel);
    carousel.attr("data-default-model-count", count);
    $(carousel).trigger("event-card-carousel-count", count);
    $(carousel).trigger("event-card-carousel-ready");
  };

  $cmp.each(function (i, item) {
    var $carousel = $(item); // hide it before the initialization is done

    $carousel.on('init', function (e, item) {
      $(e.currentTarget).removeClass("initing");
      $(e.currentTarget).show();
    });
    $carousel.not('.slick-initialized').slick({
      dots: false,
      infinite: false,
      slidesToScroll: 1,
      arrows: false,
      variableWidth: true,
      outerEdgeLimit:true,
      speed: 300,
      draggable:true,
      swipeToSlide:true

    }); // pre-filter by model

    var groupFilter = $carousel.data("show-only-model");

    if (groupFilter) {
      cardFiltering($carousel, groupFilter);
    }
  });
})(window, document);
