	function showSlide(e, forward) {
		var $currentSlide = $(e.target).parents(".question-carousel");
		var index = $currentSlide.data("slideIndex");
		var $slide;
		if (forward) {
			$slide = $(".question-carousel[data-slide-index=" + (index + 1) + "]");
		} else {
			$slide = $(".question-carousel[data-slide-index=" + (index - 1) + "]");
		}
		console.log('lastMandatory >', forward && $currentSlide.hasClass("whoareyou-lastMandatory"));
		if (forward && $currentSlide.hasClass("whoareyou-lastMandatory")) {
            
            $slide.find(".desktop-image").hide();
            $slide.find(".mobile-image").hide();
                    
			var result = JSON.parse("{}");
			for (var i = 0; i <= index; i++) {
				var options = $(".question-carousel[data-slide-index=" + i + "]").find(".aui-radio_tick.checked,.aui-checkbox.is-checked");
				options.each(function(idx, o) {
				    var key;
				    if($(o).hasClass("aui-checkbox")){
				        key = $(o).find("input").val();
				    }else{
				        key = $(o).parents(".aui-radio").find("input").val();
				    }
					if (result[key]) {
						result[key] = result[key] + 1
					} else {
						result[key] = 1;
					}
				})
			}
			var resultKey = "";
			var count = -1;
			Object.keys(result).forEach(function(key) {
				if (count < result[key]) {
					resultKey = key;
					count = result[key]
				} else if (count == result[key]) {
					resultKey = resultKey + "," + key;
				}
			})

			var resultKeyArr = resultKey.split(",");
			if (resultKeyArr.length == 1) {
				console.log("showRecommendation " + resultKeyArr[0]);
				showRecommendation(resultKeyArr[0]);
				return;
			} else {
				$slide.find(".custom-radio-btn").hide();
				$slide.find(".custom-radio-btn").removeClass("is-checked");
				$slide.find(".custom-radio-btn .aui-radio_tick").removeClass("checked");
				var selector = ".custom-radio-btn[data-option-type=" + resultKeyArr.length + "][data-option-key=" + resultKeyArr[0] + "]";
				for (var i = 1; i < resultKeyArr.length; i++) {
					selector = selector + ", .custom-radio-btn[data-option-type=" + resultKeyArr.length + "][data-option-key=" + resultKeyArr[i] + "]";
				}
                $question= $slide.find(".question");
                $pcimage= $slide.find(".desktop-image");
                $mobileimage= $slide.find(".mobile-image");
				if(resultKeyArr.length==2){
                   $question.html($question.data("question2"));
                   $pcimage.attr("src", $pcimage.data("pcimage2"));
                   $mobileimage.attr("src", $mobileimage.data("mobileimage2"));
				}else{
				   $question.html($question.data("question1"))
				   $pcimage.attr("src", $pcimage.data("pcimage1"));
                   $mobileimage.attr("src", $mobileimage.data("mobileimage1"));
				}
				$slide.find(selector).show();
				$pcimage.fadeIn();
				$mobileimage.fadeIn();
			}

		} else if (forward && $currentSlide.hasClass("whoareyou-optional")) {
			var key = $currentSlide.find(".aui-radio_tick.checked").parents(".aui-radio").find("input").val();
			showRecommendation(key);
			return;
		}
		if ($slide.length > 0) {
			$slide.show();
			$currentSlide.hide();
		}
	}
