var audioneweb_initPageModelShowroom = function audioneweb_initPageModelShowroom(
	window,
	document
) {
	var $page = $(".page.model-finder");
	if ($page.length === 0) return; //-------------------------------
	// init
	//-------------------------------

	// force to make mobile header non-fixed
	$(".cmp-header.mobile").addClass("non-fixed");

	var $modal = $(".model-finder.aui-modal");
	var $models = $page.find(".models");
	var $series = $page.find(".models .series");
	var $filterButtons = $page.find(".aui-button");
	var $cleanButton = $page.find(".clean-selection");
	var $confirmButton = $page.find(".confirm-selection");
	var $modalClose = $modal.find(
		".aui-modal-dialog__close, .modal-header .close"
	);
	var $result = $modal.find(".modal-header .result, .result.desktop");
	var $amount = $result.find(".amount"); // init variables
	var $tagContainer = $page.find(".tag-container");
	var $tagContainerList = $tagContainer.find(".tags-list");

	$tagContainer.hide();

	$(".js-range-slider").ionRangeSlider({
		type: "double",
		// values: custom_values,
		from: 20,
		to: 150,
		min: 20,
		max: 150,
		step: 10,
		hide_min_max: false,
		force_edges: false,
		skin: "round",
		postfix: "万",
		max_postfix: "+",
		grid_snap: true,
		grid: true,
		onChange: function(data) {
			filterDataByPrice(data.from, data.to);
		},
	});

	filterDataByPrice = (minVal, maxVal) => {
		let min = minVal + "0000";
		let max = maxVal == 150 ? "99999999999" : maxVal + "0000";
		$(".cmp-card-carousel__item").each((i, item) => {
			if ($(item).attr("data-msrp")) {
				let msrp = $(item)
					.attr("data-msrp")
					.split(".")[0]
					.split(",")
					.join("");

				if (
					parseInt(msrp) >= parseInt(min) &&
					parseInt(msrp) <= parseInt(max)
				) {
					$(item)
						.closest(".slick-slide")
						.removeClass("price-filtered-item")
						.show();
					$(".price-filtered-series").each(function(i, series) {
						if (!$(series).find(".price-filtered-item").length) {
							$(series).removeClass("price-filtered-series");
						}
					});
				} else {
					$(item)
						.closest(".slick-slide")
						.addClass("price-filtered-item")
						.hide();
					$(item)
						.closest(".series")
						.addClass("price-filtered-series");
					$(".price-filtered-series").each(function(i, series) {
						if (
							$(series).find(".slick-slide").length ===
							$(series).find(".price-filtered-item").length
						) {
							$(series).hide();
						} else {
							$(series).show();
						}
					});
				}
			}
		});

		let amt = $(".slick-slide").not(".price-filtered-item").length;
		$(".amount").text(amt);
		amt === 0
			? ($confirmButton.prop("disabled", true),
			  $confirmButton.addClass("disabled-btn"))
			: ($confirmButton.prop("disabled", false),
			  $confirmButton.removeClass("disabled-btn"));
	};

	var getCardLength = function getCardLength(carousel) {
		return carousel.find(".slick-slide").length;
	};

	var filterResultCount = 0;
	var modelData = {
		total: 0,
		series: {},
	}; // collect model data

	var collectModelData = function collectModelData(series) {
		var total = 0;
		series.off();
		series.on("event-card-carousel-count", function(e, count) {
			total += count;
			//$models.attr("data-total-model-amount", total);
			modelData.total = total;
			var $carousel = $(e.target);
			var defaultModel = $carousel.data("show-only-model");
			modelData.series["".concat(defaultModel)] = [];
			$carousel.find(".cmp-card-carousel__item").each(function(i, elem) {
				var bodyType;

				if ($(elem)[0].hasAttribute("data-body-type")) {
					bodyType = $(elem).data("body-type");

					if (!modelData.series[defaultModel].includes(bodyType)) {
						var bodyTypes = bodyType.split(",");

						if (bodyTypes.length > 1) {
							for (var _i = 0; _i < bodyTypes.length; _i++) {
								modelData.series[defaultModel].push(
									bodyTypes[_i]
								);
							}
						} else {
							modelData.series[defaultModel].push(bodyType);
						} // if (!modelData.series[defaultModel].indexOf(bodyType) > -1) {
					}
				}
			});
		});
	};

	collectModelData($series);
	document.addEventListener("DOMContentLoaded", function() {
		$amount.text(modelData.total);
	});
	/***
  sample code for dropdown controls
  let $checkboxEtron = $dropdown.find(".aui-dropdown__option[data-title='e-tron']");
  $checkboxEtron.find("input").attr("checked", "");
  $checkboxEtron.find(".aui-checkbox").addClass("is-checked");
  aui_dropdown.updateInput($checkboxEtron.get(0));
  aui_dropdown.open();
  setTimeout(function () {
      $checkboxEtron.find("input").removeAttr("checked");
      $checkboxEtron.find(".aui-checkbox").removeClass("is-checked");
      aui_dropdown.updateInput($checkboxEtron.get(0));
  }, 2000);
  ***/
	//-------------------------------
	// UIs
	//-------------------------------

	var $triggerFilter = $page.find(".filter .action");
	$triggerFilter.off();
	$triggerFilter.click(function(e) {
		//appear bottom section in center
		var $container = $modal.find(".aui-color-text .top-section");
		var $containerHeight = $($container)[0].offsetHeight;
		var $bottomSection = $modal.find(".aui-color-text .bottom-section");
		$($bottomSection).css(
			"height",
			"calc(100% -" + " " + $containerHeight + "px)"
		);

		setTimeout(function() {
			$(".cmp-sidebar").css("opacity", "0");
			let amt = $(".amount")
				.first()
				.text();
			parseInt(amt) === 0
				? ($confirmButton.prop("disabled", true),
				  $confirmButton.addClass("disabled-btn"))
				: ($confirmButton.prop("disabled", false),
				  $confirmButton.addClass("disabled-btn"));
		}, 200);
		saveSelectionState(_tempStates);
	}); //-------------------------------
	// state control
	//-------------------------------

	var _selectedSeries = [];
	var _stateSelections = {
		model: [],
		bodyType: [],
	};
	var _tempStates = {
		model: [],
		bodyType: [],
	}; // save current status

	var saveSelectionState = function saveSelectionState(state) {
		// reset
		state.model = [];
		state.bodyType = [];
		$modal
			.find(".selections.model button.selected")
			.each(function(i, item) {
				var model = $(item).data("model");
				state.model.push(model);
			});
		$modal
			.find(".selections.body-type button.selected")
			.each(function(i, item) {
				var type = $(item).data("body-type");
				state.bodyType.push(type);
			});
	}; // restore current status

	var restoreSelectionState = function restoreSelectionState(state) {
		$modal.find(".selections.model button").each(function(i, item) {
			var model = $(item).data("model");

			if (state.model.includes(model)) {
				$(item).addClass("selected");
			} else {
				$(item).removeClass("selected");
			}
		});
		$modal.find(".selections.body-type button").each(function(i, item) {
			var type = $(item).data("body-type");

			if (state.bodyType.includes(type)) {
				$(item).addClass("selected");
			} else {
				$(item).removeClass("selected");
			}
		});
	}; //-------------------------------
	// filtering
	//-------------------------------

	var seriesFiltering = function seriesFiltering(isAdding, data) {
		if (isAdding) {
			if (_selectedSeries.includes(data)) return;

			_selectedSeries.push(data);
		} else {
			var index = _selectedSeries.indexOf(data);

			if (index !== -1) {
				_selectedSeries.splice(index, 1);
			}
		}

		$series.each(function(i, item) {
			if (_selectedSeries.length === 0) {
				$(item).show();
				$(item)
					.find(".cmp-card-carousel")
					.slick("slickUnfilter");
				return;
			}

			if (_selectedSeries.includes($(item).data("model-series"))) {
				// clean filter
				$(item)
					.find(".cmp-card-carousel")
					.slick("slickUnfilter");
				$(item).show();
			} else {
				$(item).hide();
			}
		}); // sync between dropdown & modal filters

		$filterButtons.each(function(i, item) {
			// cancel all body type
			if ($(item).data("body-type")) {
				$(item).removeClass("selected");
			}

			if (_selectedSeries.includes($(item).data("model-series"))) {
				$(item).addClass("selected");
			} else {
				$(item).removeClass("selected");
			}
		});
	};

	var modelFiltering = function modelFiltering(state) {
		var totalCount = 0; // handle series show hide

		$series.each(function(i, item) {
			$(item).hide(); // handle series
			if (state.model.length !== 0) {
				var model = $(item).data("model");

				if (state.model.includes(model)) {
					$(item).show();
				}
			} // empty list means show all
			else {
				$(item).show();
			}

			var $carousel = $(item).find(".cmp-card-carousel"); // handle model show hide

			totalCount += renderingCarousel($carousel, state); // delay for transition to completed

			setTimeout(function() {
				// final filter, hide series that has no child
				if ($carousel.find(".slick-slide").length === 0) {
					$(item).hide();
				}
			}, 400);

			if (
				$(item).find(".slick-slide").length ===
				$(item).find(".price-filtered-item").length
			) {
				$(item).hide();
			} else {
				$(item).show();
			}
		});
		if (
			$modal.find(".selections.model button.selected").length == 0 &&
			$modal.find(".selections.body-type button.selected").length == 0
		) {
			$amount.text(modelData.total === 0 ? 0 : modelData.total - $('.price-filtered-item').length);
      modelData.total === 0 && filterDataByPrice($(".js-range-slider").data('ionRangeSlider').result.from, $(".js-range-slider").data('ionRangeSlider').result.to);
			$result.show();
		} else if (totalCount !== $models.data("total-model-amount")) {
			$amount.text(totalCount === 0 ? 0 : totalCount  - $('.price-filtered-item').length);
			$result.show();
		} else {
			$result.hide();
		}

		let amt = $(".amount")
			.first()
			.text();
		parseInt(amt) === 0
			? ($confirmButton.prop("disabled", true),
			  $confirmButton.addClass("disabled-btn"))
			: ($confirmButton.prop("disabled", false),
			  $confirmButton.addClass("disabled-btn"));
	};

	var renderingCarousel = function renderingCarousel(carousel, state) {
		if (!carousel) return; // clean filter

		carousel.slick("slickUnfilter"); // start filter

		carousel.slick("slickFilter", function(i, item) {
			if (state.bodyType.length !== 0 && state.model.length === 0) {
				if (
					$(item)
						.find(".cmp-card-carousel__item")[0]
						.hasAttribute("data-body-type")
				) {
					var data = $(item)
						.find(".cmp-card-carousel__item")
						.data("body-type")
						.split(",");

					for (i = 0; i < data.length; i++) {
						if (
							state.bodyType.includes(data[i]) &&
							carousel.data("show-only-model") ===
								$(item)
									.find(".cmp-card-carousel__item")
									.data("model")
						) {
							return true;
						}
					}
				} else {
					return false;
				}
			} else if (state.bodyType.length !== 0) {
				if (
					$(item)
						.find(".cmp-card-carousel__item")[0]
						.hasAttribute("data-body-type")
				) {
					var data = $(item)
						.find(".cmp-card-carousel__item")
						.data("body-type")
						.split(",");

					for (i = 0; i < data.length; i++) {
						if (
							state.bodyType.includes(data[i]) &&
							state.model.includes(
								$(item)
									.find(".cmp-card-carousel__item")
									.data("model")
							) &&
							carousel.data("show-only-model") ===
								$(item)
									.find(".cmp-card-carousel__item")
									.data("model")
						) {
							return true;
						}
					}
				} else {
					return false;
				}
			}
			// empty list means show all
			else if (state.model.length === 0 && state.bodyType.length === 0) {
				if (
					carousel.data("show-only-model") ===
					$(item)
						.find(".cmp-card-carousel__item")
						.data("model")
				) {
					return true;
				} else {
					return false;
				}
			} // filter by model
			else {
				if (
					state.model.includes(
						$(item)
							.find(".cmp-card-carousel__item")
							.data("model")
					) &&
					carousel.data("show-only-model") ===
						$(item)
							.find(".cmp-card-carousel__item")
							.data("model")
				) {
					return true;
				} else {
					return false;
				}
			}
		});
		return getCardLength(carousel);
	}; //-------------------------------
	// interactions
	//-------------------------------

	var selectedModels = [];
	var selectedBodyTypes = [];

	var setupButtonsOnOff = function setupButtonsOnOff(button) {
		var model = button.data("model");
		var bodyTypes = modelData.series["".concat(model)];
		var selected = button.hasClass("selected"); // add or remove model

		if (selected) {
			selectedModels.push(model);
		} else {
			selectedModels = selectedModels.filter(function(obj) {
				return obj != model;
			});
		} // append body type to list if absent

		selectedBodyTypes = [];
		selectedModels.forEach(function(elem) {
			var picked = modelData.series["".concat(elem)];

			if (picked) {
				picked.forEach(function(obj) {
					if (!selectedBodyTypes.includes(obj)) {
						selectedBodyTypes.push(obj);
					}
				});
			}
		}); // body type on off control on UI

		/*$filterButtons.each(function (i, item) {
      var bodyType = $(item).data("is-body-type");

      if (bodyType) {
        if (selectedBodyTypes.includes($(item).data("body-type"))) {
          $(item).removeAttr("disabled");
        } else {
          $(item).attr("disabled", "");
          $(item).removeClass("selected");
        }
      }
    });*/
	};

	$filterButtons.off();
	$filterButtons.each(function(i, item) {
		$(item).off();
		$(item).click(function(e) {
			$(e.currentTarget).toggleClass("selected");
			setupButtonsOnOff($(item));
			saveSelectionState(_tempStates);
			modelFiltering(_tempStates);
			disableFilterBodyTypeButtons(_tempStates, item);
			createTags(_tempStates);
		});
	});
	$cleanButton.click(function(e) {
		$filterButtons.each(function(i, item) {
			$(item).removeClass("selected");
		});
		$cleanButton.removeClass("selected");
		$(".result").attr("style", "display: none !important");
		$tagContainerList.empty();
		$tagContainer.hide();
		$(".js-range-slider")
			.data("ionRangeSlider")
			.reset();
		$(".series")
			.removeClass("price-filtered-series")
			.show();
		$(".slick-slide")
			.removeClass("price-filtered-item")
			.show();

		$confirmButton.prop("disabled", true);
		$confirmButton.addClass("disabled-btn");
	});

	createTags = (state) => {
		$tagContainerList.empty();
		if (state.bodyType.length) {
			state.bodyType.forEach((item) => {
				let elem = `<div class="filter-tag filter-body-type"><span>${item}</span><i class="close aui-icon-cancel-small"></i></div>`;
				$tagContainerList.append(elem);
			});
		}
		if (state.model.length) {
			state.model.forEach((item) => {
				let elem = `<div class="filter-tag filter-model"><span>${item}</span><i class="close aui-icon-cancel-small"></i></div>`;
				$tagContainerList.append(elem);
			});
		}
		if (state.bodyType.length || state.model.length) {
			let elem = `<div class="filter-tag filter-clear"><span>取消筛选</span><i class="close aui-icon-cancel-small"></i></div>`;
			$tagContainerList.append(elem);
			$tagContainer.show();
			createTagEvent();
		} else {
			$tagContainer.hide();
		}
	};

	createTagEvent = () => {
		$(".filter-tag").each((i, tag) => {
			$(tag)
				.off("click")
				.on("click", function() {
					$(".aui-button.selected").each((i, button) => {
						if (
							$(button)
								.find(".aui-button__text")
								.text() ===
							$(tag)
								.find("span")
								.text()
						) {
							$(button).trigger("click");
						}
					});
				});
		});

		$(".filter-clear")
			.off("click")
			.on("click", () => {
				$(".aui-button.selected").each((i, button) => {
					$(button).trigger("click");
				});
			});
	};

	disableFilterBodyTypeButtons = (state, btn) => {
		if (
			$(btn)
				.closest(".selections")
				.hasClass("model")
		) {
			$(".selections.body-type button").removeClass("disabled");
			$(".selections.body-type button").prop("disabled", false);
		}
		if (
			state.model.length &&
			$(btn)
				.closest(".selections")
				.hasClass("model")
		) {
			let arr = [];
			state.model.forEach((item) => {
				$(`.series[data-model="${item}"]`)
					.find(".cmp-card-carousel__item")
					.each((i, item) => {
						$(item).attr("data-body-type") &&
							arr.push(
								$(item)
									.attr("data-body-type")
									.split(",")
							);
					});
			});

			$(".selections.body-type button").each((i, button) => {
				let arr1 = arr.flat();

				if (
					!arr1.includes(
						$(button)
							.find(".aui-button__text")
							.text()
					)
				) {
					$(button).addClass("disabled");
					$(button).prop("disabled", true);
				} else {
					$(button).removeClass("disabled");
					$(button).prop("disabled", false);
				}
			});
		}
	};
	$confirmButton.off();
	$confirmButton.click(function(e) {
		saveSelectionState(_stateSelections);
		modelFiltering(_stateSelections);
	});
	$modalClose.off();
	$modalClose.click(function(e) {
    let amt = $(".amount")
    .first()
    .text();

    if (parseInt(amt) === 0) {
      // resume to previous states
      modelFiltering({
        model: "",
        bodyType: "",
      }); // reset

      selectedModels = [];
      _stateSelections.model = [];
      _stateSelections.bodyType = [];
      $filterButtons.each(function(i, item) {
        $(item).removeClass("selected");
      });
      createTags(_stateSelections);
      /*$modal.find(".selections.body-type button").each(function (i, item) {
        $(item).attr("disabled", "");
      });*/
      $(".js-range-slider")
        .data("ionRangeSlider")
        .reset();
      $(".series")
        .removeClass("price-filtered-series")
        .show();
      $(".slick-slide")
        .removeClass("price-filtered-item")
        .show();
    }
		setTimeout(function() {
			$(".cmp-sidebar").css("opacity", "1");
		}, 200);
	});
};

