      for (var index = 0; index < carBoxLists.length; index++) {
        var element = carBoxLists[index];

        if (isEnabled) {
          $(element).removeClass("grey-overlay");
        } else {
          var hasSelectedItem = $(element).hasClass("hasSelectedItem");

          if (!hasSelectedItem) {
            $(element).addClass("grey-overlay");
          }
        }
      }
