    disableOrEnableOtherCheckBox: function disableOrEnableOtherCheckBox(isDisabled) {
      for (var key in this.compareCarContainer) {
        if (Object.hasOwnProperty.call(this.compareCarContainer, key)) {
          var input = $("#"+key);
          var labels = input.parents(".car-option").find("label");

          for (var index = 0; index < labels.length; index++) {
            var label = $(labels[index]);

            if (isDisabled) {
              label.parent(".custom-checkbox-car-compare").removeClass("checkBoxDisabled");
            } else {
              if (!label.hasClass("is-checked")) {
                label.parent(".custom-checkbox-car-compare").addClass("checkBoxDisabled");
              }
            }
          }
        }
      }
    }
