(function (window, document) {
  var functions = {
    retrievedParsedData: null,
    onInit: function onInit() {
      this.compilePathVariable();
      this.bindScrollEvent();
      this.retrieveData();
      this.bindEvent();
    },
      compilePathVariable: function compilePathVariable() {
          $(document).ready(function (event) {
              var carType = window.location.pathname.split(".");

              if (carType[1]) {
                  var carTypeId = carType[1];
                  var carBox = $(".car-box[data-model-id=".concat(carTypeId, "]"));
                  if( carBox && carBox.offset() && carBox.offset().top){
                      $('html, body').animate({
                          scrollTop: carBox.offset().top -72
                      }, 500)
                  }

                  carBox.find(".car-option-wrapper").show();

              }
          });
      },
    retrieveData: function retrieveData() {
      var data = document.cookie.split("carCompareInfo=")[1];

      if (!data) {
        return;
      }

      this.retrievedParsedData = JSON.parse(data);
    },
    bindEvent: function bindEvent() {
      $(".collapse").click(function (e) {
        var target = $(e.currentTarget);
        target.siblings(".table").toggle();
        target.children("i").animate({}, 500, function (e) {
         if (!this.style.cssText || this.style.cssText == "transform: rotate(0deg);") {
            $(this).css({
              'transform': 'rotate(180deg)'
            });
          } else {
            $(this).css({
              'transform': 'rotate(0)'
            });
          }
        });
      });
      $(document).on('click','.close-button',function (event) {
        var target = $(event.currentTarget);
        $("#"+target.parents("li").data("path")).siblings("input").trigger("click");
        var carInfoTile = target.parents(".car-info-tile");
        var index = target.data("index");
        var $removedItems=$(".info-item".concat(index));
        $removedItems.attr("data-removed","true");
        $removedItems.hide();
        carInfoTile.hide();
        $(".car-compare-details-lists-wrapper").append("<li class=\"car-info-tile no-car\"><i class=\"aui-icon-system-add-large\"></i><div>\u9009\u62E9\u8F66\u578B</div></li>");
        $(".car-info-tile.no-car i").click(function (event) {
          $(".car-compare-details").hide();
          $(".car-compare").show();
        });
        if($(".see-all-different div.active").data("text")!="all"){
            showDifferentOnly();
        }
      });
      function showDifferentOnly(){
          $(".basic-figure h3.item").hide();
          var $rowItems = $(".row-item");
          $rowItems.hide();
          for (var index = 0; index < $rowItems.length; index++) {
            var rowItem = $($rowItems[index]);
            var items = rowItem.find(".item[data-removed!=true]");
            var firstItem = $(items[0]);
            var firstItemStandard = firstItem.hasClass("black-circle");
            var firstItemOptional = firstItem.hasClass("empty-circle");
            var firstItemNotProvided = firstItem.hasClass("symbol-forbidden");
            var firstItemValue = firstItem.text();

            for (var _index = 1; _index < items.length; _index++) {
              var item = $(items[_index]);
              var itemValue = item.text();
              var standard = item.hasClass("black-circle");
              var optional = item.hasClass("empty-circle");
              var notProvided = item.hasClass("symbol-forbidden");

              if (itemValue != firstItemValue || firstItemStandard!=standard || firstItemOptional !=optional || firstItemNotProvided != notProvided) {
                var $prev = rowItem.prev();
                while($prev.length>0){
                    if($prev.hasClass("item")){
                        $prev.show();
                        break;
                    }
                    $prev = $prev.prev();
                }
                rowItem.show();
                break;
              }
              //firstItem = item;
            }
          }
      }
      $(".see-all-different div").click(function (event) {
        var target = $(event.currentTarget);
        var text = target.data("text");
        target.addClass("active");
        target.siblings("div").removeClass("active");

        if (text == "all") {
          $("h3.item").show();
          $(".row-item").show();
        } else {
          showDifferentOnly();
        }
      });
    },
    bindScrollEvent: function bindScrollEvent() {
      function scrollDelay() {
        $(window).on("scroll", function (e) {
          if (!$(".car-compare-details-header").length) {
            return;
          }

          var windowScroll = $(window).scrollTop();
          var windowWidth = $(window).innerWidth();
          var compareCondition = 72;
          var topMenu = $(".top-menu");
          var height = $(".car-compare-details-header").offset().top + $(".car-compare-details-header").innerHeight();

          if (windowWidth < 768) {
            compareCondition = 60;
          }

          if (windowScroll >= height && !topMenu.hasClass("fixed")) {
            topMenu.addClass("fixed");
          }

          if (windowScroll < height && topMenu.hasClass("fixed")) {
            topMenu.removeClass("fixed");
          } //stick btn above footer when footer visible


         /* if ($(".cmp-footer").length !== 0) {
            var top_of_element = $(".cmp-footer").offset().top;
            var bottom_of_element = $(".cmp-footer").offset().top + $(".cmp-footer").outerHeight();
            var bottom_of_screen = $(window).scrollTop() + $(window).innerHeight();
            var top_of_screen = $(window).scrollTop();

            if (bottom_of_screen > top_of_element && top_of_screen < bottom_of_element) {
              $(".car-compare").find(".selected-car").css("position", "static");
            } else {
              $(".car-compare").find(".selected-car").css("position", "fixed");
            }
          }*/
        }).trigger("scroll");
      }

      window.setInterval(scrollDelay, 1000);
    }
  };
  functions.onInit();
})(window, document);
