(function (window, document) {

    var $cmps = $(".text-image-countdown");
    if ($cmps.length === 0) return;

    $cmps.each(function (i, elm) {
        // count UIs
        var $cmp = $(elm);
        var $dateRoot = $cmp.find(".count-down-time");
        var targetDate = $dateRoot.data("target-date");
        console.log('targetDate >>', targetDate);
        
        var day1 = $dateRoot.find(".day1");
        var day2 = $dateRoot.find(".day2");
        var hour1 = $dateRoot.find(".hour1");
        var hour2 = $dateRoot.find(".hour2");
        var min1 = $dateRoot.find(".min1");
        var min2 = $dateRoot.find(".min2");
        var sec1 = $dateRoot.find(".sec1");
        var sec2 = $dateRoot.find(".sec2");
        
        
        // init 
        var dayTime1 = 0;
        var dayTime2 = 0;
        var hourTime1 = 0;
        var hourTime2 = 0;
        var minTime1 = 0;
        var minTime2 = 0;
        var secTime1 = 0;
        var secTime2 = 0;
        var endtime = new Date(targetDate);   //定义结束时间
        var showtime = function () {
            var nowtime = new Date();  //获取当前时间
            var lefttime = endtime.getTime() - nowtime.getTime(),  //距离结束时间的毫秒数
                leftd = String(Math.floor(lefttime / (1000 * 60 * 60 * 24))),  //计算天数
                lefth = String(Math.floor(lefttime / (1000 * 60 * 60) % 24)),  //计算小时数
                leftm = String(Math.floor(lefttime / (1000 * 60) % 60)),  //计算分钟数
                lefts = String(Math.floor(lefttime / 1000 % 60));  //计算秒数
            if (leftd < 10) {
                dayTime1 = 0;
                dayTime2 = leftd;
            } else {
                dayTime1 = leftd[0];
                dayTime2 = leftd[1];
            }
    
            if (lefth < 10) {
                hourTime1 = 0;
                hourTime2 = lefth;
            } else {
                hourTime1 = lefth[0];
                hourTime2 = lefth[1];
            }
    
            if (leftm < 10) {
                minTime1 = 0;
                minTime2 = leftm;
            } else {
                minTime1 = leftm[0];
                minTime2 = leftm[1];
            }
    
            if (lefts < 10) {
                secTime1 = 0;
                secTime2 = lefts;
            } else {
                secTime1 = lefts[0];
                secTime2 = lefts[1];
            }
    
            if (dayTime1 <= 0) {
                dayTime1 = 0;
            }
    
            if (dayTime2 <= 0) {
                dayTime2 = 0;
            }
    
            if (hourTime1 <= 0) {
                hourTime1 = 0;
            }
    
            if (hourTime2 <= 0) {
                hourTime2 = 0;
            }
    
            if (minTime1 <= 0) {
                minTime1 = 0;
            }
    
            if (minTime2 <= 0) {
                minTime2 = 0;
            }
    
            if (secTime1 <= 0) {
                secTime1 = 0;
            }
    
            if (secTime2 <= 0) {
                secTime2 = 0;
            }
    
    
            if (dayTime1 == 0 &&
                dayTime2 == 0 &&
                hourTime1 == 0 &&
                hourTime2 == 0 &&
                minTime1 == 0 &&
                minTime2 == 0 &&
                secTime1 == 0 &&
                secTime2 == 0) {
                clearInterval(count_timer)
            }
        }
        
        // trigger
        var count_timer = setInterval(function () {
            showtime();
            day1.text(dayTime1);
            day2.text(dayTime2);
            hour1.text(hourTime1);
            hour2.text(hourTime2);
            min1.text(minTime1);
            min2.text(minTime2);
            sec1.text(secTime1);
            sec2.text(secTime2);
        }, 1000);
    });
    

})(window, document);
