(function(window, document) {

	function getUrlParam(url) {

		let arrObj = url.split("?");
		let params = Object.create(null)
		if (arrObj.length > 1) {
			arrObj = arrObj[1].split("&");
			params = paramStrToObj(arrObj)
		}
		return params;
	}

	function paramStrToObj(paramStr) {
		let params = Object.create(null)
		paramStr.forEach(item => {
			item = item.split("=");
			params[item[0]] = item[1]
		})
		return params;
	}

	function parseParam(param, key) {
		var paramStr = "";
		if (param instanceof String || param instanceof Number || param instanceof Boolean) {
			paramStr += "&" + key + "=" + encodeURIComponent(param);
		} else {
			$.each(param, function(i) {
				var k = key == null ? i : key + (param instanceof Array ? "[" + i + "]" : "." + i);
				paramStr += '&' + parseParam(this, k);
			});
		}
		return paramStr.substr(1);
	};

	$(document).on("DOMContentLoaded", function(e) {

		var iFrame = $('.iframeSection');


		if (iFrame.length !== 0) {

			for (let i = 0; i < iFrame.length; i++) {
				// console.log(iFrame[i])

				var mobInternalLink = $(iFrame[i]).find('.linkInfo').attr('data-mobileInternalLink');
				var mobExternalLink = $(iFrame[i]).find('.linkInfo').attr('data-mobileExternalLink');
				var pcInternalLink = $(iFrame[i]).find('.linkInfo').attr('data-pcInternalLink');
				var pcExternalLink = $(iFrame[i]).find('.linkInfo').attr('data-pcExternalLink');
				var linkParameters = $(iFrame[i]).find('.linkInfo').attr('data-linkParameters');
				var getParentWindowParameters = $(iFrame[i]).find('.linkInfo').attr(
					'data-getParentWindowParameters');
				const getParentWindowParametersFlag = getParentWindowParameters === 'true' ? true : false


				if (mobInternalLink == undefined) {
					mobInternalLink = pcInternalLink;
				}

				if (mobExternalLink == undefined) {
					mobExternalLink = pcExternalLink;
				}
				if (getParentWindowParametersFlag) {
					var parentUrl = window.location.href
					var parentParams = getUrlParam(parentUrl);
					var pcExternalParams = getUrlParam(pcExternalLink)
					var mobExternalParams = getUrlParam(mobExternalLink)
					var linkParametersObj = {}
					mobExternalLink = mobExternalLink.split("?")[0]
					pcExternalLink = pcExternalLink.split("?")[0]
					if (linkParameters) {
						linkParametersObj = paramStrToObj(linkParameters.split("&"));
					}
					var allParams = {}
					if (window.innerWidth < 768) {
						Object.assign(allParams, mobExternalParams, linkParametersObj, parentParams);
					} else {
						Object.assign(allParams, pcExternalParams, linkParametersObj, parentParams);
					}
					// console.log("after allParams", allParams)
					linkParameters = parseParam(allParams)
				}



				if (window.innerWidth < 768) {

					if (linkParameters) {
						mobInternalLink ? $(iFrame[i]).find('iframe').attr('src', mobInternalLink + "?" +
							linkParameters) : $(iFrame[i]).find('iframe').attr('src', mobExternalLink +
							"?" + linkParameters);
					} else {
						mobInternalLink ? $(iFrame[i]).find('iframe').attr('src', mobInternalLink) : $(
							iFrame[i]).find('iframe').attr('src', mobExternalLink);

					}
					$(iFrame[i]).find('iframe').attr("style", "height:" + $(iFrame[i]).find('iframe').attr(
						'mobile-height') + " !important");
				} else {

					if (linkParameters) {
						pcInternalLink ? $(iFrame[i]).find('iframe').attr('src', pcInternalLink + "?" +
							linkParameters) : $(iFrame[i]).find('iframe').attr('src', pcExternalLink +
							"?" + linkParameters);
					} else {
						pcInternalLink ? $(iFrame[i]).find('iframe').attr('src', pcInternalLink) : $(iFrame[
							i]).find('iframe').attr('src', pcExternalLink);

					}

				}
			}
		}

	});


})(window, document);


window.onload = function() {

	var frame = document.getElementsByClassName('iframeSection');

	var iframeParents = new Array();

	// console.log(frame, 'ggg');

	if (frame.length !== 0) {
		window.addEventListener('message', function(e) {
			for (let i = 0; i < frame.length; i++) {

				iframeParents[i] = frame[i].getAttribute('id'); //iframe父级
				var data = e.data;

				if (data && data === 'iframeScrollDown') {

					$('html, body').animate({
						scrollTop: '+=100px'
					}, 'slow');
				}

				//console.log(data.data.text, 'text')
				if (data.data &&data.data.text&&data.data.height&& iframeParents[i] == data.data.text) {
					var height = (data.data.height + 20) + 'px';
					var frameHeight = document.getElementById(iframeParents[i])
						.getElementsByTagName("iframe")[0];
					frameHeight.style.height = height;
					console.log(iframeParents[i]+" "+height + '给予高度');
				};
			}
		});
	}


}; // end of window.onload

