"use strict";



// ----------------------------------------------------------------------------

// contactUs

// ----------------------------------------------------------------------------



(function (window, document) {
    if (!$(".cmp-contact-us").length) return;
    $(document).on("DOMContentLoaded", function (e){

         if(window.innerWidth < 768){
				let $imgSection = $('.img-section');
				let $contentSection = $('.content-section');
				if($contentSection){
				$imgSection.height("".concat(window.innerHeight-($contentSection[0].offsetHeight), "px"));
            }
		}

    });





    $('.contact-us-determine').on('click',function () {
		var checkedValue = $('.contact-us-options .custom-radio-btn').find('.checked');
		if($(checkedValue).length !== 0){
             var determineURL= $(checkedValue).parent().find('input').attr('data-link');
       		 var determineTarget=$(checkedValue).parent().find('input').attr('data-target');
             
            if(determineURL != undefined){
                if(determineTarget === '_blank'){
                    window.open(determineURL,'_blank');
                }else{
                    window.location.href=determineURL;
                }
            }

        }

 })







})(window, document);
"use strict";



(function (window, document) {
$('.image-promotion-card-carousel').not('.slick-initialized').slick({
dots: true,
infinite: false,
slidesToScroll: 1,
slidesToShow: 1,
arrows: false,
variableWidth: true,
outerEdgeLimit: true,
speed: 300,
focusOnSelect: true,
draggable:true,
swipeToSlide:true,
});



})(window, document);
