"use strict";

// ----------------------------------------------------------------------------
// slideshow
// ----------------------------------------------------------------------------
(function(window, document) {
	var $cmp = $(".cmp-car-model-multitab");
	console.log($cmp);
	if ($cmp.length === 0) return;

	let sliderFn = () => {
    let left_slider = $cmp.find(".left-slider .slick");
    let right_slider = $cmp.find(".right-slider");

    var numSlick = 0;
    $(left_slider).each(function() {
      numSlick++;

      let height = $cmp.height();
      let width = $cmp.width();
      let item_length = $(this).find(".item").length;

      switch (true) {
        case item_length >= 3:
          height = height / 3;
          width = width / 3;
          break;
        case item_length === 2:
          height = height / 2;
          width = width / 2;
          break;
        default:
          break;
      }

      $(this)
        .addClass("left-slider-" + numSlick)
        .slick({
          asNavFor: ".right-slider-" + numSlick,
          vertical: true,
          verticalSwiping: true,
          slidesToShow: $(this).find(".item").length >= 3 ? 3 : 2,
          slidesToScroll: 1,
          focusOnSelect: true,
          //centerMode: true,
          centerPadding: 0,
          centerMode: true,
          rows: 0,
          prevArrow:
            '<span class="aui-button__text icon aui-icon-arrow-narrow-up-large slick-aui-prev"></span>',
          nextArrow:
            '<span class="aui-button__text icon aui-icon-arrow-narrow-down-large slick-aui-next"></span>',
          responsive: [
            {
              breakpoint: 1024,
              settings: {
                slidesToShow:
                  $(this).find(".item").length >= 3 ? 3 : 2,
                centerPadding: 0,
                slidesToScroll: 1,
                infinite: true,
                dots: false,
                centerMode: true,
                useTransform: true,
                vertical: false,
                rows: 0,
                prevArrow:
                  '<span class="aui-button__text icon aui-icon-back-large slick-aui-prev"></span>',
                nextArrow:
                  '<span class="aui-button__text icon aui-icon-forward-large slick-aui-next"></span>',
              },
            },
          ],
        });

      if (window.innerWidth > 767) {
        $(this)
          .find(".slick-slide")
          .css({
            height,
          });
          $(this).find('.slick-active').first().addClass('first-active')
      } else {
        $(this)
          .find(".slick-slide")
          .css({
            width,
          });
      }
    });

    var numSlick = 0;
    $(right_slider).each(function() {
      numSlick++;

      $(this)
        .addClass("right-slider-" + numSlick)
        .slick({
          // asNavFor: slideshow_tab_wrapper,
          slidesToShow: 1,
          slidesToScroll: 1,
          arrows: false,
          fade: true,
          cssEase: "linear",
          dots: false,
          swipe: false,
          touchMove: false,
          centerMode: true,
          rows: 0,
        });
    });

    let internal_slider = $cmp.find(".right-slider .slide-item");
    for (var index = 0; index < internal_slider.length; index++) {
      let child_slider = $(internal_slider[index]).find(".child-slider");
      let child_slider_tabs = $(internal_slider[index]).find(
        ".child-slider-tabs"
      );
      $(child_slider).attr("id", `child-slider-${index}`);
      $(child_slider_tabs).attr("id", `child-slider-tabs-${index}`);
      console.log(child_slider);
      console.log(child_slider_tabs);
    }

    var numSlick = 0;
    $(".child-slider").each(function() {
      numSlick++;

      $(this)
        .addClass("slider-" + numSlick)
        .slick({
          slidesToShow: 1,
          slidesToScroll: 1,
          arrows: false,
          fade: true,
          centerMode: true,
          centerPadding: 0,
          swipe: false,
          touchMove: false,
          rows: 0,
          asNavFor: ".child-slider-tabs.slider-" + numSlick,
          prevArrow:
            '<span class="aui-button__text icon aui-icon-back-large slick-aui-prev"></span>',
          nextArrow:
            '<span class="aui-button__text icon aui-icon-forward-large slick-aui-next"></span>',
          rows: 0,
        });

      $(this).append(
        `<span class='aui-button__text icon aui-icon-back-large slick-aui-prev prevArrow slider-${numSlick}'></span>`
      );
      $(this).append(
        `<span class='aui-button__text icon aui-icon-forward-large slick-aui-next nextArrow slider-${numSlick}'></span>`
      );
    });

    numSlick = 0;
    $(".child-slider-tabs").each(function() {
      numSlick++;
      console.log($(".prevArrow.slider-" + numSlick));
      $(this)
        .addClass("slider-" + numSlick)
        .slick({
          vertical: false,
                  variableWidth: $(this).find(".slide-item-child").length > 3 ? true : false,
          slidesToShow: $(this).find(".slide-item-child").length >= 3 ? 3 : 2,
          slidesToScroll: 1,
          asNavFor: ".child-slider.slider-" + numSlick,
          arrows: true,
          prevArrow: $(".prevArrow.slider-" + numSlick),
          nextArrow: $(".nextArrow.slider-" + numSlick),
          focusOnSelect: true,
          rows: 0,
          centerPadding: 0,
          centerMode: true,
          responsive: [
            {
              breakpoint: 767,
              settings: {
                arrows: true,
                prevArrow:
                  '<span class="aui-button__text icon aui-icon-back-large slick-aui-prev"></span>',
                nextArrow:
                  '<span class="aui-button__text icon aui-icon-forward-large slick-aui-next"></span>',
              },
            },
          ],
        });
    });

    $(left_slider).on("afterChange", function(
      event,
      slick,
      currentSlide,
      nextSlide
    ) {
      $(right_slider)
        .find(".slide-item.slick-current .child-slider-tabs")
        .slick("slickGoTo", 0);

      if (window.innerWidth > 767) {
        $(this).find('.slick-active').removeClass('first-active')
        $(this).find('.slick-active').first().addClass('first-active')
      }
    });
  }

  setTimeout(() => {
    sliderFn();
  }, 500);
})(window, document);

"use strict";

// ----------------------------------------------------------------------------
// model display
// ----------------------------------------------------------------------------
(function(window, document) {
	var $cmp = $(".cmp-comparison-section");
	if ($cmp.length === 0) return;

	if (window.innerWidth >= 767) {
        $cmp.find('.cmp-comparison-section--mobile-image').remove();
      } else {
        $cmp.find('.cmp-comparison-section--desktop-image').remove();
      }

	let endHeight = "+=" + $cmp.innerHeight();
	let bg = $cmp.find(".comparisonSection").attr("data-bg-image");

	$cmp.find(".comparisonSection").css("background-image", `url('${bg}')`);
	gsap.utils.toArray(".comparisonSection").forEach((section) => {
		let tl = gsap.timeline({
			scrollTrigger: {
				trigger: section,
				start: "15px 15px",
				end: endHeight,
				scrub: true,
				pin: $cmp.closest(".section"),
				pinSpacing: true,
				// markers: true,
				anticipatePin: 1,
			},
			defaults: { ease: "none" },
		});
		// animate the container one way...

		var div_list = document.querySelectorAll(".afterImage"); // returns NodeList
		var div_array = [...div_list]; // converts NodeList to Array
		div_array.forEach((div, i) => {
			console.log(i);
			tl.fromTo(div, { xPercent: -100, x: 0 }, { xPercent: 0 }, i)
				// ...and the image the opposite way (at the same time)
				.fromTo(
					div.querySelector("img"),
					{ xPercent: 100, x: 0 },
					{ xPercent: 0 },
					i
				);
		});

		tl.fromTo(
			".reveal",
			{ yPercent: 100, y: 0 },
			{ yPercent: window.innerWidth >= 767 ? -5 : -15, duration: 1 }
		);
	});
})(window, document);

"use strict";

$(document).ready(function(){
	var selector_value=$('#selectorValue').attr('data-selector');
	var selector_value_lang=$('#selectorValueLang').attr('data-selector');
	var selector_value_pdk=$('#selectorValuePDK').attr('data-selector');
    var templateHTML = $("#audiCode-template").html();
    if(selector_value&& templateHTML){
        var template = Handlebars.compile(templateHTML);
        Handlebars.registerHelper('price', function(price) {
            return price > 0 ? price : "待定"
        });

        Handlebars.registerHelper('classification', function(classification) {
            return classification == 'STANDARD_EQUIPMENT'? "标配" : "";
        });

        Handlebars.registerHelper('showClass', function(classification) {
            return classification == 'STANDARD_EQUIPMENT'? true: false;
        });

        if( template){
            $.ajax({
                type: 'GET',
                url:'/bin/accb/audi-code.'+ selector_value + '.' + selector_value_lang + '.' + selector_value_pdk +'.json',
                async:false,
                success: function(response){
                    var displayValue = encodeURI(selector_value);
                    if(response.code == 200){
                        response.data['audi_code'] = "奥迪代码: " + displayValue + " ";
                        var price = response.data['price'] ;
                        if( price != 0  && price !== '0' && price !=='待定'){
                            response.data['typePrice'] =  "￥ "+response.data['price'] ;
                        }

                        // workaround to control ui by overwrite default value
                        response.data['showPriceInfo'] = false;
                        response.data['configPrice'] = false;

                        if(response.data['configPrice']){
                            response.data['hasConfigPrice'] = true;
                        }

                        // AA tracking
                        if(window._satellite){
                            window._satellite.track('audi-code-page-open', {'car-type' : response.data['modelDesc']})
                        }

                        $('.aui-modal-open.static').html(template(response.data));
                    }else{
                        response.data={};
                        response.data['audi_code'] = "没有找到与奥迪代码"+displayValue+"对应的信息。";
                        $('.order__container').hide();
                    }
                    $('.aui-modal-open.static').html(template(response.data));
                }
            });
        }

    }




});







