(function (window, document) {
  var $cmp = $(".cmp-appdl");
  if ($cmp.length === 0) return;
  /**
   * Determine the mobile operating system.
   * This function returns one of 'iOS', 'Android', 'Windows Phone', or 'unknown'.
   *
   * @returns {String}
   */

  var getMobileOperatingSystem = function getMobileOperatingSystem() {
    var userAgent = navigator.userAgent || navigator.vendor || window.opera;

    if (/windows phone/i.test(userAgent)) {
      return "Windows Phone";
    }

    if (/android/i.test(userAgent)) {
      return "Android";
    }

    if (/iPad|iPhone|iPod/.test(userAgent) && !window.MSStream) {
      return "iOS";
    }

    return "desktop";
  };

  $cmp.find(".close-app-download").on("click", function (e) {
    $cmp.find(".my-audi-app").css("display", "none");
  });
  $cmp.find(".get-btn").click(function (e) {
    var url = "";
    var appId = "";
    var device = $cmp.data("device-placeholder");

    if (device === 'Android' || device === "Windows Phone") {
      url = "";
      appId = $cmp.attr("data-play-store-package-id");
    } else {
      url = $cmp.attr("data-app-store");
      appId = $cmp.attr("data-app-store-package-id");
    }

    window.location.href = "".concat(url).concat(appId);
  });
  $(document).ready(function () {
    $cmp.attr("data-device-placeholder", getMobileOperatingSystem());
  });
})(window, document);
